webpackJsonp([1166],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-stringprototypecharat.json":function(t,e){t.exports={data:{markdownRemark:{html:'<p>The <code>charAt()</code> method returns the specified character from a string.</p>\n<h2>Syntax</h2>\n<pre><code>str.charAt(index)\n</code></pre>\n<h2>Parameters</h2>\n<p><strong>index</strong></p>\n<p>An integer between 0 and 1-less-than the length of the string.</p>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/charAt">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/LIBRary/65zt5h10(v=vs.94).aspx">MSDN link</a></p>\n<h2>Description</h2>\n<p>Characters in a string are indexed from left to right. The index of the first character is 0, and the index of the last character in a string called <code>stringName</code> is <code>stringName.length - 1</code>. If the index you supply is out of range, JavaScript returns an empty string.</p>\n<h2>Examples</h2>\n<pre><code>var anyString = \'Brave new world\';\n\nconsole.log("The character at index 0   is \'" + anyString.charAt(0)   + "\'"); // \'B\'\nconsole.log("The character at index 1   is \'" + anyString.charAt(1)   + "\'"); // \'r\'\nconsole.log("The character at index 2   is \'" + anyString.charAt(2)   + "\'"); // \'a\'\nconsole.log("The character at index 3   is \'" + anyString.charAt(3)   + "\'"); // \'v\'\nconsole.log("The character at index 4   is \'" + anyString.charAt(4)   + "\'"); // \'e\'\nconsole.log("The character at index 999 is \'" + anyString.charAt(999) + "\'"); // \'\'\n\nvar str = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";\ndocument.write(str.charAt(str.length - 1));\n\n// Output: Z\n</code></pre>',frontmatter:{title:"String.prototype.charAt",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-stringprototypecharat/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-stringprototypecharat/"}}}});
